import React from "react";
import "../../../Styles/Pages/Manage/ManageFifth.scss";

function ManageFifth() {
  return (
    <div className='manageFifth'>
      <div className='manageFifth__left'>
        <div className='icon'></div>
        <h1>Global Compliance</h1>
        <p>
          With decades of experience in mitigating risk and maintaining global
          compliance.
        </p>
      </div>
      <div className='manageFifth__right'>
        <div className='icon'></div>
        <h1>Customer Lifecycle Marketing</h1>
        <p>
          The key to earning customer loyalty is to present them the most
          relevant content exactly when they need it.
        </p>
      </div>
    </div>
  );
}

export default ManageFifth;
